import React from 'react';
import styled from 'styled-components';
import { BsArrowClockwise } from 'react-icons/bs';
import { FcCustomerSupport } from 'react-icons/fc';
import { GrInstall } from 'react-icons/gr';

const Services = () => {
	return (
		<ServicesWrapper>
			<article className='item'>
				<GrInstall />
				<p>
					We own expertise in supplying installing all types of hardware
					including server machines, client terminals, network cabling, routers
					and data storage equipment etc.
				</p>
			</article>
			<article className='item'>
				<FcCustomerSupport />
				<p>
					We offer 24x7 dedicated support. Our customer care service is
					specially set up to take care of the needs of our valuable customers.
					Our goal is to make our client happy with our services.
				</p>
			</article>
			<article className='item'>
				<GrInstall />
				<p>
					We own expertise in supplying installing all types of hardware
					including server machines, client terminals, network cabling, routers
					and data storage equipment etc.
				</p>
			</article>
		</ServicesWrapper>
	);
};

export default Services;

const ServicesWrapper = styled.section`
	width: 100%;
	margin: 5rem 0;
	text-align: center;
`;
